import React from 'react';

class ProjectResult extends React.Component {
    constructor(props){
        super(props);
    }

    render() {
        return (this.props.project)
            ? (<section className="resume-section p-3 p-lg-5 d-flex align-items-center">
                <div className="mw-100">
                    <h1 className="mb-0">{this.props.project.Name}
                        <div className="text-secondary"> {this.props.project.Role}</div>
                    </h1>
                    <div>
                        <h2>Pr√©sentation :</h2>
                        <ul>
                            {this.props.project.types.map(
                                (item) =>
                                    <li>{item.type["name"]}</li>
                            )}
                        </ul>
                    </div>
                    <div>
                        <h2>Objectif, Contexte, Enjeu, Risque :</h2>
                        <ul>
                            {this.props.project.types.map(
                                (item) =>
                                    <li>{item.type["name"]}</li>
                            )}
                        </ul>
                    </div>
                    <div>
                        <h2>Missions</h2>
                        {this.props.project.missions.map(
                            (mission) =>
                                <div>
                                    <span>{mission["base_stat"]}</span>
                                    <span>{mission.stat["name"]}</span>
                                    <div style={{width: mission["base_stat"] + 'px',
                                        border: '1px solid black'}} ></div>
                                </div>
                        )}
                    </div>
                    <div className="row">
                        <div className="col">
                            1 of 2
                        </div>
                        <div className="col">
                            2 of 2
                        </div>
                    </div>
                    {this.props.project.types.map(
                        (item) =>
                            <div>
                                <h2>Average {item.type["name"]} Stats</h2>
                                <p>url des type :{item.type["url"]
                                }</p>
                                <p>pokemon du meme type:</p>
                            </div>
                    )}
                </div>
                </section>
            )
            : ( <section>Vide</section>);
    }
}

export default ProjectResult;
